    false,nt"url": null,nt"notes": "The United States Virgin Islands Topographic
    LiDAR project collected topographic elevation point data derived from multiple return
    light detection and ranging (LiDAR) measurements on the islands of St. Thomas, St.
    John, St. Croix and numerous smaller islands and islets in the United States Virgin
    Islands. The islands of St. Thomas and St. John were acquired between November 9,
    2013 and November 19, 2013. The island of St. Croix was acquired between November
    27, 2013 and December 10, 2013. The entire area was comprised of 88 planned flight
    lines and approximately 1669 flight line kilometers. LiDAR was collected at an average
    of 0.7 meter point spacing for all acquired project areas. The classification classes
    as available from the NOAA Digital Coast are: 1 (Unclassified), 2 (Bare-earth ground),
    7 (Noise), 9 (Water), 10 (Ignored Ground, points close to breakline features), 16
    (Overlap Water), 17 (Overlap Unclassified), 18 (Overlap Bare-earth ground). Hydro
    flattened breaklines and Digital Elevation Models (DEMs) are also available for
    download. Please see the Supplemental Information field below for links to these
    data sets.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
